import{_ as e,o,c as t,O as n}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 16.1-91.1 Costs to be included in judgment on forthcoming bond.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-91.1.md","filePath":"vacode/16.1-91.1.md"}'),r={name:"vacode/16.1-91.1.md"},a=n('<h1 id="§-16-1-91-1-costs-to-be-included-in-judgment-on-forthcoming-bond" tabindex="-1">§ 16.1-91.1 Costs to be included in judgment on forthcoming bond. <a class="header-anchor" href="#§-16-1-91-1-costs-to-be-included-in-judgment-on-forthcoming-bond" aria-label="Permalink to &quot;§ 16.1-91.1 Costs to be included in judgment on forthcoming bond.&quot;">​</a></h1><p>The judge of a general district court, on giving judgment on a forthcoming bond, shall include in the costs of the judgment the clerk&#39;s fee as stated in subdivision A 21 of § <a href="http://law.lis.virginia.gov/vacode/17.1-275/" target="_blank" rel="noreferrer">17.1-275</a>; and the clerk shall not receive any fee or reward for any service he is required to perform by the provisions of § <a href="http://law.lis.virginia.gov/vacode/8.01-529/" target="_blank" rel="noreferrer">8.01-529</a>, except that specified in subdivision A 21 of § <a href="http://law.lis.virginia.gov/vacode/17.1-275/" target="_blank" rel="noreferrer">17.1-275</a>.</p><p>Code 1950, § 8-460; 1962, c. 10; 1977, c. 624.</p>',3),i=[a];function d(s,c,l,h,_,f){return o(),t("div",null,i)}const m=e(r,[["render",d]]);export{u as __pageData,m as default};
